"use client";

import { programApplicationFormLongTextFieldSchema } from "@/lib/zod/schemas/program-application-form";
import {
  Button,
  Modal,
  Switch,
  useEnterSubmit,
  useMediaQuery,
} from "@dub/ui";
import { Dispatch, SetStateAction, useId } from "react";
import { Controller, useForm } from "react-hook-form";
import { z } from "zod";
import { v4 as uuid } from "uuid";
import { motion } from "framer-motion";

type LongTextFieldData = z.infer<typeof programApplicationFormLongTextFieldSchema>

type LongTextFieldModalProps = {
  showModal: boolean;
  setShowModal: Dispatch<SetStateAction<boolean>>;
  defaultValues?: Partial<LongTextFieldData>;
  onSubmit: (data: LongTextFieldData) => void;
};

export function LongTextFieldModal(props: LongTextFieldModalProps) {
  return (
    <Modal showModal={props.showModal} setShowModal={props.setShowModal}>
      <LongTextFieldModalInner {...props} />
    </Modal>
  );
}

function LongTextFieldModalInner({
  setShowModal,
  onSubmit,
  defaultValues,
}: LongTextFieldModalProps) {
  const id = useId();
  const { isMobile } = useMediaQuery();
  const {
    control,
    handleSubmit,
    register,
    formState: { errors },
  } = useForm<LongTextFieldData>({
    defaultValues: defaultValues ?? {
      id: uuid(),
      type: "long-text",
      label: "",
      required: true,
      data: {
        placeholder: "",
        maxLength: undefined,
      },
    },
  });

  const { handleKeyDown } = useEnterSubmit();

  return (
    <>
      <div className="p-4 pt-3">
        <h3 className="text-base font-semibold leading-6 text-neutral-800">
          {defaultValues ? "Edit" : "Add"} long text
        </h3>
        <form
          className="mt-4 flex flex-col gap-6"
          onSubmit={(e) => {
            e.stopPropagation();
            handleSubmit(async (data) => {
              setShowModal(false);
              onSubmit(data);
            })(e);
          }}
        >

          {/* Label */}
          <div>
            <label
              htmlFor={`${id}-label`}
              className="flex items-center gap-2 text-sm font-medium text-neutral-700"
            >
              Input label
            </label>
            <div className="mt-2 rounded-md shadow-sm">
              <input
                id={`${id}-title`}
                type="text"
                placeholder=""
                autoFocus={!isMobile}
                className="block w-full rounded-md border-neutral-300 text-neutral-900 placeholder-neutral-400 focus:border-neutral-500 focus:outline-none focus:ring-neutral-500 text-sm"
                {...register("label", { required: true })}
              />
            </div>
          </div>

          {/* Placeholder */}
          <div>
            <label
              htmlFor={`${id}-placeholder`}
              className="flex items-center gap-2 text-sm font-medium text-neutral-700"
            >
              Input placeholder
            </label>
            <div className="mt-2 rounded-md shadow-sm">
              <input
                id={`${id}-placeholder`}
                type="text"
                placeholder=""
                autoFocus={!isMobile}
                className="block w-full rounded-md border-neutral-300 text-neutral-900 placeholder-neutral-400 focus:border-neutral-500 focus:outline-none focus:ring-neutral-500 text-sm"
                {...register("data.placeholder")}
              />
            </div>
          </div>

          { /* Required */}
          <div>
            <Controller
              name="required"
              control={control}
              render={({ field }) => (
                <label className="flex items-center justify-between gap-1.5" htmlFor={`${id}-required`}>
                  <span className="text-sm font-medium text-neutral-700">
                    Required
                  </span>
                  <Switch
                    id={`${id}-required`}
                    checked={field.value}
                    fn={field.onChange}
                    trackDimensions="radix-state-checked:bg-black focus-visible:ring-black/20 w-7 h-4"
                    thumbDimensions="size-3"
                    thumbTranslate="translate-x-3"
                  />
                </label>
              )}
            />
          </div>

          { /* Max characters */}
          <div>
            <Controller
              name="data.maxLength"
              control={control}
              render={({ field }) => {
                const showMaxCharactersStepper = typeof field.value === "number";

                return (
                  <div className="flex flex-col gap-2">
                    <label className="flex items-center justify-between gap-1.5" htmlFor={`${id}-max-length`}>
                      <span className="text-sm font-medium text-neutral-700">
                        Max characters
                      </span>
                      <Switch
                        id={`${id}-max-length`}
                        checked={field.value !== undefined}
                        fn={(checked) => {
                          if (checked) {
                            field.onChange(10);
                          } else {
                            field.onChange(undefined);
                          }
                        }}
                        trackDimensions="radix-state-checked:bg-black focus-visible:ring-black/20 w-7 h-4"
                        thumbDimensions="size-3"
                        thumbTranslate="translate-x-3"
                      />
                    </label>

                    <motion.div
                      animate={{
                        height: showMaxCharactersStepper ? "auto" : 0,
                        overflow: "hidden",
                      }}
                      transition={{
                        duration: 0.15,
                      }}
                      initial={false}
                    >
                      <input
                        id={`${id}-max-length`}
                        type="number"
                        min={1}
                        max={2000}
                        placeholder=""
                        value={
                          field.value == null || isNaN(field.value) ? "" : field.value
                        }
                        onChange={(e) => {
                          const val = e.target.value;
                          field.onChange(
                            val === "" ? null : parseFloat(val),
                          );
                        }}
                        autoFocus={!isMobile}
                        className="block w-full rounded-md border-neutral-300 text-neutral-900 placeholder-neutral-400 focus:border-neutral-500 focus:outline-none focus:ring-neutral-500 text-sm"
                      />
                    </motion.div>
                  </div>
                )
              }}
            />
          </div>

          <div className="flex items-center justify-end gap-2">
            <Button
              onClick={() => setShowModal(false)}
              variant="secondary"
              text="Cancel"
              className="h-8 w-fit px-3"
            />
            <Button
              type="submit"
              variant="primary"
              text={defaultValues ? "Update" : "Add"}
              className="h-8 w-fit px-3"
            />
          </div>
        </form >
      </div >
    </>
  );
}

